import React from "react";

function LezzetlerList() {
  return (
    <div>
      <div className="flex relative w-96 h-[36rem] bg-slate-500">
        <img
          className="absolute -z-10"
          src="https://www.mcdonalds.com.tr/assets/img/products-box-bg.jpg"
          alt=""
        />
        <img
          className="absolute"
          src="https://www.mcdonalds.com.tr/Files//264f0d51-09a0-4ad8-8d43-e692f97f2397-bigmactek.png"
          alt=""
        />
      </div>
    </div>
  );
}

export default LezzetlerList;
